import React, { useState } from 'react';
import { QElementProvider, QElementComponent } from './qelements';
import QElementTooltip from './QElementTooltip';

// Music Platform Components
const MusicPlatform = () => {
  const [activeTab, setActiveTab] = useState('discover');
  const [selectedArtist, setSelectedArtist] = useState<any>(null);
  const [userRating, setUserRating] = useState(0);

  const artists = [
    { id: 1, name: 'Luna Eclipse', genre: 'Electronic', followers: '2.3M', rating: 4.8, image: '🎵' },
    { id: 2, name: 'Neon Dreams', genre: 'Synthwave', followers: '1.8M', rating: 4.9, image: '🎶' },
    { id: 3, name: 'Crimson Waves', genre: 'Rock', followers: '3.1M', rating: 4.7, image: '🎸' },
    { id: 4, name: 'Digital Pulse', genre: 'EDM', followers: '4.2M', rating: 4.9, image: '🎧' },
    { id: 5, name: 'Midnight Sonata', genre: 'Classical', followers: '1.5M', rating: 4.6, image: '🎼' },
    { id: 6, name: 'Electric Storm', genre: 'Metal', followers: '2.7M', rating: 4.8, image: '⚡' }
  ];

  const trendingSongs = [
    { title: 'Digital Sunset', artist: 'Luna Eclipse', plays: '12.4M', duration: '3:42' },
    { title: 'Neon Nights', artist: 'Neon Dreams', plays: '8.9M', duration: '4:15' },
    { title: 'Crimson Tide', artist: 'Crimson Waves', plays: '15.2M', duration: '3:28' },
    { title: 'Electric Dreams', artist: 'Digital Pulse', plays: '22.1M', duration: '3:55' }
  ];

  return (
    <QElementProvider>
      <div style={{ minHeight: '100vh', background: 'linear-gradient(135deg, #1a1a1a 0%, #2d1b1b 50%, #1a1a1a 100%)' }}>
        {/* Header */}
        <QElementComponent elementId="header">
          <header style={{ 
            padding: '1rem 2rem',
            background: 'linear-gradient(90deg, #000000 0%, #2d1b1b 50%, #000000 100%)',
            borderBottom: '2px solid #dc2626',
            boxShadow: '0 4px 20px rgba(220, 38, 38, 0.3)'
          }}>
            <div style={{ display: 'flex', justifyContent: 'space-between', alignItems: 'center', maxWidth: '1200px', margin: '0 auto' }}>
              <div style={{ display: 'flex', alignItems: 'center', gap: '1rem' }}>
                <h1 style={{ color: '#ffffff', margin: 0, fontSize: '2rem', fontWeight: 'bold' }}>
                  🎵 SoundWave
                </h1>
                <span style={{ color: '#dc2626', fontSize: '0.9rem', fontWeight: '500' }}>
                  Music Sharing Platform
                </span>
              </div>
              <nav style={{ display: 'flex', gap: '2rem' }}>
                {['discover', 'artists', 'trending', 'profile'].map(tab => (
                  <button
                    key={tab}
                    onClick={() => setActiveTab(tab)}
                    style={{
                      color: activeTab === tab ? '#dc2626' : '#ffffff',
                      background: 'none',
                      border: 'none',
                      fontSize: '1rem',
                      fontWeight: activeTab === tab ? '600' : '400',
                      cursor: 'pointer',
                      textTransform: 'capitalize',
                      borderBottom: activeTab === tab ? '2px solid #dc2626' : '2px solid transparent',
                      padding: '0.5rem 0',
                      transition: 'all 0.3s ease'
                    }}
                  >
                    {tab}
                  </button>
                ))}
              </nav>
            </div>
          </header>
        </QElementComponent>

        {/* Main Content */}
        <QElementComponent elementId="main-content">
          <main style={{ maxWidth: '1200px', margin: '0 auto', padding: '2rem' }}>
            {activeTab === 'discover' && (
              <div>
                <h2 style={{ color: '#ffffff', marginBottom: '2rem', fontSize: '2rem' }}>
                  🔍 Discover New Music
                </h2>
                <div style={{ 
                  display: 'grid', 
                  gridTemplateColumns: 'repeat(auto-fit, minmax(300px, 1fr))', 
                  gap: '1.5rem' 
                }}>
                  {artists.map(artist => (
                    <QElementComponent key={artist.id} elementId="artist-card">
                      <div style={{
                        background: 'linear-gradient(145deg, #2a2a2a 0%, #1a1a1a 100%)',
                        borderRadius: '12px',
                        padding: '1.5rem',
                        border: '1px solid #dc2626',
                        cursor: 'pointer',
                        transition: 'all 0.3s ease',
                        boxShadow: '0 4px 15px rgba(0,0,0,0.3)'
                      }}
                      onMouseEnter={(e) => {
                        e.currentTarget.style.transform = 'translateY(-5px)';
                        e.currentTarget.style.boxShadow = '0 8px 25px rgba(220, 38, 38, 0.4)';
                      }}
                      onMouseLeave={(e) => {
                        e.currentTarget.style.transform = 'translateY(0)';
                        e.currentTarget.style.boxShadow = '0 4px 15px rgba(0,0,0,0.3)';
                      }}
                      onClick={() => setSelectedArtist(artist)}
                      >
                        <div style={{ display: 'flex', alignItems: 'center', gap: '1rem', marginBottom: '1rem' }}>
                          <div style={{ fontSize: '3rem' }}>{artist.image}</div>
                          <div>
                            <h3 style={{ color: '#ffffff', margin: '0 0 0.5rem 0', fontSize: '1.2rem' }}>
                              {artist.name}
                            </h3>
                            <p style={{ color: '#dc2626', margin: '0', fontSize: '0.9rem' }}>
                              {artist.genre}
                            </p>
                          </div>
                        </div>
                        <div style={{ display: 'flex', justifyContent: 'space-between', alignItems: 'center' }}>
                          <span style={{ color: '#ffffff', fontSize: '0.9rem' }}>
                            {artist.followers} followers
                          </span>
                          <div style={{ display: 'flex', alignItems: 'center', gap: '0.5rem' }}>
                            <span style={{ color: '#ffd700', fontSize: '1.1rem' }}>⭐</span>
                            <span style={{ color: '#ffffff', fontSize: '0.9rem' }}>
                              {artist.rating}
                            </span>
                          </div>
                        </div>
                      </div>
                    </QElementComponent>
                  ))}
                </div>
              </div>
            )}

            {activeTab === 'artists' && selectedArtist && (
              <div>
                <div style={{ 
                  background: 'linear-gradient(145deg, #2a2a2a 0%, #1a1a1a 100%)',
                  borderRadius: '12px',
                  padding: '2rem',
                  border: '2px solid #dc2626',
                  marginBottom: '2rem'
                }}>
                  <div style={{ display: 'flex', alignItems: 'center', gap: '2rem', marginBottom: '2rem' }}>
                    <div style={{ fontSize: '5rem' }}>{selectedArtist.image}</div>
                    <div>
                      <h2 style={{ color: '#ffffff', margin: '0 0 0.5rem 0', fontSize: '2.5rem' }}>
                        {selectedArtist.name}
                      </h2>
                      <p style={{ color: '#dc2626', margin: '0 0 1rem 0', fontSize: '1.2rem' }}>
                        {selectedArtist.genre} • {selectedArtist.followers} followers
                      </p>
                      <div style={{ display: 'flex', alignItems: 'center', gap: '1rem' }}>
                        <span style={{ color: '#ffd700', fontSize: '1.5rem' }}>⭐</span>
                        <span style={{ color: '#ffffff', fontSize: '1.2rem' }}>
                          {selectedArtist.rating}/5.0
                        </span>
                      </div>
                    </div>
                  </div>

                  <div style={{ marginBottom: '2rem' }}>
                    <h3 style={{ color: '#ffffff', marginBottom: '1rem' }}>Rate This Artist</h3>
                    <div style={{ display: 'flex', gap: '0.5rem' }}>
                      {[1, 2, 3, 4, 5].map(star => (
                        <button
                          key={star}
                          onClick={() => setUserRating(star)}
                          style={{
                            background: 'none',
                            border: 'none',
                            fontSize: '2rem',
                            cursor: 'pointer',
                            color: star <= userRating ? '#ffd700' : '#666666',
                            transition: 'color 0.2s ease'
                          }}
                        >
                          ⭐
                        </button>
                      ))}
                    </div>
                    {userRating > 0 && (
                      <p style={{ color: '#dc2626', marginTop: '0.5rem' }}>
                        Thanks for rating! You gave {userRating} stars.
                      </p>
                    )}
                  </div>
                </div>
              </div>
            )}

            {activeTab === 'trending' && (
              <div>
                <h2 style={{ color: '#ffffff', marginBottom: '2rem', fontSize: '2rem' }}>
                  🔥 Trending Now
                </h2>
                <div style={{ 
                  background: 'linear-gradient(145deg, #2a2a2a 0%, #1a1a1a 100%)',
                  borderRadius: '12px',
                  padding: '1.5rem',
                  border: '1px solid #dc2626'
                }}>
                  {trendingSongs.map((song, index) => (
                    <QElementComponent key={index} elementId="trending-song">
                      <div style={{
                        display: 'flex',
                        justifyContent: 'space-between',
                        alignItems: 'center',
                        padding: '1rem',
                        borderBottom: index < trendingSongs.length - 1 ? '1px solid #333333' : 'none',
                        cursor: 'pointer',
                        transition: 'background-color 0.2s ease'
                      }}
                      onMouseEnter={(e) => {
                        e.currentTarget.style.backgroundColor = '#333333';
                      }}
                      onMouseLeave={(e) => {
                        e.currentTarget.style.backgroundColor = 'transparent';
                      }}
                      >
                        <div style={{ display: 'flex', alignItems: 'center', gap: '1rem' }}>
                          <span style={{ color: '#dc2626', fontSize: '1.2rem', fontWeight: 'bold' }}>
                            #{index + 1}
                          </span>
                          <div>
                            <h4 style={{ color: '#ffffff', margin: '0 0 0.25rem 0' }}>
                              {song.title}
                            </h4>
                            <p style={{ color: '#dc2626', margin: '0', fontSize: '0.9rem' }}>
                              {song.artist}
                            </p>
                          </div>
                        </div>
                        <div style={{ display: 'flex', alignItems: 'center', gap: '2rem' }}>
                          <span style={{ color: '#ffffff', fontSize: '0.9rem' }}>
                            {song.plays} plays
                          </span>
                          <span style={{ color: '#dc2626', fontSize: '0.9rem' }}>
                            {song.duration}
                          </span>
                          <button style={{
                            background: 'linear-gradient(45deg, #dc2626, #ff4444)',
                            color: '#ffffff',
                            border: 'none',
                            borderRadius: '6px',
                            padding: '0.5rem 1rem',
                            cursor: 'pointer',
                            fontSize: '0.9rem',
                            fontWeight: '500'
                          }}>
                            ▶️ Play
                          </button>
                        </div>
                      </div>
                    </QElementComponent>
                  ))}
                </div>
              </div>
            )}

            {activeTab === 'profile' && (
              <div>
                <h2 style={{ color: '#ffffff', marginBottom: '2rem', fontSize: '2rem' }}>
                  👤 Your Profile
                </h2>
                <div style={{ 
                  display: 'grid', 
                  gridTemplateColumns: 'repeat(auto-fit, minmax(300px, 1fr))', 
                  gap: '1.5rem' 
                }}>
                  <QElementComponent elementId="profile-card">
                    <div style={{
                      background: 'linear-gradient(145deg, #2a2a2a 0%, #1a1a1a 100%)',
                      borderRadius: '12px',
                      padding: '2rem',
                      border: '1px solid #dc2626'
                    }}>
                      <h3 style={{ color: '#ffffff', marginBottom: '1rem' }}>Your Stats</h3>
                      <div style={{ display: 'flex', flexDirection: 'column', gap: '1rem' }}>
                        <div style={{ display: 'flex', justifyContent: 'space-between' }}>
                          <span style={{ color: '#ffffff' }}>Songs Shared:</span>
                          <span style={{ color: '#dc2626' }}>47</span>
                        </div>
                        <div style={{ display: 'flex', justifyContent: 'space-between' }}>
                          <span style={{ color: '#ffffff' }}>Artists Discovered:</span>
                          <span style={{ color: '#dc2626' }}>23</span>
                        </div>
                        <div style={{ display: 'flex', justifyContent: 'space-between' }}>
                          <span style={{ color: '#ffffff' }}>Total Ratings:</span>
                          <span style={{ color: '#dc2626' }}>156</span>
                        </div>
                      </div>
                    </div>
                  </QElementComponent>

                  <QElementComponent elementId="recent-activity">
                    <div style={{
                      background: 'linear-gradient(145deg, #2a2a2a 0%, #1a1a1a 100%)',
                      borderRadius: '12px',
                      padding: '2rem',
                      border: '1px solid #dc2626'
                    }}>
                      <h3 style={{ color: '#ffffff', marginBottom: '1rem' }}>Recent Activity</h3>
                      <div style={{ display: 'flex', flexDirection: 'column', gap: '0.75rem' }}>
                        <div style={{ color: '#ffffff', fontSize: '0.9rem' }}>
                          🎵 Shared "Digital Sunset" by Luna Eclipse
                        </div>
                        <div style={{ color: '#ffffff', fontSize: '0.9rem' }}>
                          ⭐ Rated Neon Dreams 5 stars
                        </div>
                        <div style={{ color: '#ffffff', fontSize: '0.9rem' }}>
                          🔍 Discovered Electric Storm
                        </div>
                      </div>
                    </div>
                  </QElementComponent>
                </div>
              </div>
            )}
          </main>
        </QElementComponent>

        {/* Footer */}
        <QElementComponent elementId="footer">
          <footer style={{
            background: 'linear-gradient(90deg, #000000 0%, #2d1b1b 50%, #000000 100%)',
            borderTop: '2px solid #dc2626',
            padding: '2rem',
            marginTop: '3rem'
          }}>
            <div style={{ maxWidth: '1200px', margin: '0 auto', textAlign: 'center' }}>
              <h3 style={{ color: '#ffffff', marginBottom: '1rem' }}>
                🎵 SoundWave - Powered by QElements
              </h3>
              <p style={{ color: '#dc2626', margin: '0', fontSize: '0.9rem' }}>
                Built with QElements for cascading styles, themes, and responsive design
              </p>
            </div>
          </footer>
        </QElementComponent>
      </div>
    </QElementProvider>
  );
};

export default MusicPlatform;
